//EXPLANATION AND LIST OF KEYCODES//

To define keys, refer to the table below and change the relevant key value.
To disable an option use 0

HotkeyXMenuAmount refers to the amount of submenus defined (e.g. Misc - Helpful - Give Health would be 3)
HotkeyXMenuY refers to the bottom left corner ID of the submenu the option's in minus 1 (e.g. Misc menu would be Menu1=4, Helpful would be Menu2=0, Give Health would be Menu3=11)
HotkeyXKey1 is the key the hotkey's bound to, or the key to hold down if UsesMultiple is enabled
If UsesMultiple is enabled, HotkeyXKey2 is the key to press while Key1 is held down
If UseSubtitle is enabled, HotkeyXSubtitle is the string that gets printed as subtitle when the hotkey's activated

